import { ScrollView, StyleSheet, Text, View } from 'react-native';
import { HeroLight } from './../components/Hero/HeroLight';
import { CardRecommendation } from '../components/Card/CardRecommendation';

const title = `Do we need a profile page?`;
const description = `We'll work alongside you to get the best insights, support and guidance through your journey.`;
const buttonText = `Life with Cala Trio`;
const link = `List`;

export const ProfileScreen = ({ navigation }) => {
  return (
    <ScrollView contentContainerStyle={styles.container}>
      <HeroLight
        title={title}
        description={description}
        buttonText={buttonText}
        link={link}
      />

      <View style={styles.content}>
        <Text style={styles.description}>Haven't put in Profile yet.</Text>
      </View>
    </ScrollView>
  );
};

const styles = StyleSheet.create({
  container: {
    display: 'flex',
    flexDirection: 'column',
    flex: 1,
    width: '100%',
    alignItems: 'center',
    padding: 0,
  },
  content: {
    display: 'flex',
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
    width: '100%',
    //backgroundColor: 'green',
  },
  description: {
    fontFamily: Fonts.FONT_FACE_DESCRIPTION,
    fontSize: Fonts.FONT_SIZE_DESCRIPTION,
    color: Colors.NAVY,
    textAlign: 'center',
    lineHeight: Fonts.FONT_SIZE_DESCRIPTION * 1.5,
    //backgroundColor: 'red',
  },
});
